import React from 'react'

function NameList() {

    const names = ['Ratnesh', 'Rajiv', 'Navin']

    return (

        <div>
            <h2>{names}[0]</h2>
            <h2>{names}[1]</h2>
            <h2>{names}[2]</h2>
        </div>


    )
}

export default NameList
